import React from "react";
import { useNavigate } from "react-router-dom";
import "../Home.css"; // Import the CSS file

// Define the props interface
interface AuthLayoutProps {
    title: string; // The title prop must be a string
    onToggle: (mode: string) => void; // onToggle function receives a string parameter
}

const AuthLayout: React.FC<AuthLayoutProps> = ({ title, onToggle }) => {
    const navigate = useNavigate();

    return (
        <div className="home-container">
            <div className="flex-container">
                {/* Logo section */}
                <div className="logo-section">
                    <div className="logo-box">
                        (Logo) Eleos
                    </div>
                </div>

                {/* Log In and Sign Up Buttons */}
                <div className="button-section">
                    <button
                        onClick={() => {
                            onToggle("login");
                            navigate("/login");
                        }}
                        className="button button-login"
                    >
                        Log In
                    </button>
                    <button
                        onClick={() => {
                            onToggle("signup");
                            navigate("/signup");
                        }}
                        className="button button-signup"
                    >
                        Sign Up
                    </button>
                </div>
            </div>
            <h2>{title}</h2>
        </div>
    );
};

export default AuthLayout;
